import { BsArrowLeftSquareFill } from "react-icons/bs";
import { BsArrowRightSquareFill } from "react-icons/bs";

export default function Pagination() {
  return (
    <div className="pagination">
      <BsArrowLeftSquareFill className="arrow-left"></BsArrowLeftSquareFill>
      <ul className="pageItems"></ul>
      <BsArrowRightSquareFill className="arrow-right"></BsArrowRightSquareFill>
    </div>
  );
}
